import counter from "src/store/counter";
import React from "react";

const Counter = () => {
  return (
    <div>
      <button onClick={() => counter.incremement()}>+</button>
      <span>{counter.count}</span>
      <button onClick={() => counter.decrement()}>-</button>
    </div>
  );
};
export default Counter;
